import './substrate.css'

export default function Substrate({children, styles, addClass}) {
  const classSubstrate = addClass ? '{addClass} + substrate' : 'substrate'

  return (
    <>
      <div className={classSubstrate} style={styles}>
        {children}
      </div>
    </>
  );
}
